import React from "react";
import "./style.css";

function SupportNav () {
    return (

        <ul id="links">
            <li>
                <a href="*" target="blank">Advanced Search |</a>
            </li>

            <li>
                <a href="*" target="blank"> Support |</a>
            </li>

            <li>
                <a href="*" target="blank"> About |</a>
            </li>

            <li>
                <a href="*" target="blank"> Login</a>
            </li>
        </ul>

    );
}

export default SupportNav;
